(function () {
  if (typeof window === 'undefined') return;

  // NOTE: use a script-specific cleanup hook so we don't fight with any
  // other BreadboardAutoWire helper in the host app.
  if (typeof window.__breadboardScriptAutoWireCleanup === 'function') {
    try {
      window.__breadboardScriptAutoWireCleanup();
    } catch (err) {
      console.warn('[BreadboardAutoWire] Failed to clean up previous script instance:', err);
    }
  }
  window.__breadboardScriptAutoWireCleanup = null;

  const ROW_SEGMENT_TOP = 'top';
  const ROW_SEGMENT_BOTTOM = 'bottom';
  const SEGMENT_ROW_FALLBACK = {
    [ROW_SEGMENT_TOP]: 'A',
    [ROW_SEGMENT_BOTTOM]: 'F'
  };
  const MIN_BODY_WIDTH = 16;
  const MIN_BODY_HEIGHT = 24;
  const BODY_MARGIN = 12;
  const normalizeRowName = (value) => {
    if (value === undefined || value === null) return null;
    const normalized = String(value).trim().toUpperCase();
    return normalized || null;
  };
  const makeSegmentColumnKey = (segment, column) => `${segment}::${column}`;
  const isRailSegment = (segment) =>
    typeof segment === 'string' && segment.toLowerCase().startsWith('rail-');
  const getRailRowLabel = (segment) => {
    if (!isRailSegment(segment)) return null;
    return segment.includes('negative') ? 'GND' : 'V+';
  };
  const SNAP_OFFSET_X = 0;
  const DEFAULT_INPUT_HANDLE_KEY = 'in';
  const makeHandleNodeId = (nodeId, handleKey) => `handle:${nodeId}:${handleKey || DEFAULT_INPUT_HANDLE_KEY}`;
  const CONDUCTIVE_COMPONENTS = {
    'io.breadboard.components:resistor': [['pinA', 'pinB']],
    'io.breadboard.components:railTapPositive': [['rail', 'tap']],
    'io.breadboard.components:railTapNegative': [['rail', 'tap']],
    'io.breadboard.components:jumper': [['wireA', 'wireB']],
    'io.breadboard.sockets:railSocket': [
      ['vplus', 'positive'],
      ['gnd', 'negative']
    ]
  };

  const isPlainObject = (value) =>
    value !== null &&
    typeof value === 'object' &&
    Object.prototype.toString.call(value) === '[object Object]';

  const clampColumn = (column, minColumn, maxColumn) => {
    if (!Number.isFinite(column)) return minColumn || 1;
    const min = Number.isFinite(minColumn) ? minColumn : column;
    const max = Number.isFinite(maxColumn) ? maxColumn : column;
    return Math.max(min, Math.min(max, Math.round(column)));
  };

  const normalizeSegmentName = (value) => {
    if (!value && value !== 0) return null;
    const normalized = String(value).trim().toLowerCase();
    if (normalized === 'top' || normalized === 'upper' || normalized === 'a') return ROW_SEGMENT_TOP;
    if (normalized === 'bottom' || normalized === 'lower' || normalized === 'b') return ROW_SEGMENT_BOTTOM;
    const rowChar = normalized.charAt(0).toUpperCase();
    if (['A', 'B', 'C', 'D', 'E'].includes(rowChar)) return ROW_SEGMENT_TOP;
    if (['F', 'G', 'H', 'I', 'J'].includes(rowChar)) return ROW_SEGMENT_BOTTOM;
    return null;
  };

  const normalizeSegmentPreference = (value) => {
    if (!value && value !== 0) return 'same';
    const normalized = String(value).trim().toLowerCase();
    if (isRailSegment(normalized)) return normalized;
    if (normalized === 'opposite' || normalized === 'other') return 'opposite';
    if (normalized === 'same' || normalized === 'auto') return 'same';
    const explicitSegment = normalizeSegmentName(normalized);
    return explicitSegment || 'same';
  };

  const resolveSegmentPreference = (preference, baseSegment) => {
    if (isRailSegment(preference)) {
      return preference;
    }
    if (preference === ROW_SEGMENT_TOP || preference === ROW_SEGMENT_BOTTOM) {
      return preference;
    }
    if (preference === 'opposite') {
      return baseSegment === ROW_SEGMENT_TOP ? ROW_SEGMENT_BOTTOM : ROW_SEGMENT_TOP;
    }
    return baseSegment || ROW_SEGMENT_TOP;
  };

  const resolvePinSegment = (node, pinInfo, baseSegment) => {
    const handleKey = pinInfo?.handleKey || pinInfo?.originalPin?.id;
    if (node?.type === 'io.breadboard.components:railTapNegative') {
      if (handleKey === 'tap') {
        return ROW_SEGMENT_BOTTOM;
      }
      if (handleKey === 'rail') {
        return 'rail-bottom-negative';
      }
    }
    if (node?.type === 'io.breadboard.components:railTapPositive') {
      if (handleKey === 'tap') {
        return ROW_SEGMENT_TOP;
      }
      if (handleKey === 'rail') {
        return 'rail-top-positive';
      }
    }
    return resolveSegmentPreference(pinInfo?.segmentPreference, baseSegment);
  };

  const coerceRailTarget = (currentEntry, currentSegment, column, node, handleKey, layout) => {
    if (!node || handleKey !== 'rail') {
      return { entry: currentEntry, segment: currentSegment };
    }
    const type = node.type || '';
    let fallbackSegment = null;
    if (type === 'io.breadboard.components:railTapNegative') {
      fallbackSegment = 'rail-bottom-negative';
    } else if (type === 'io.breadboard.components:railTapPositive') {
      fallbackSegment = 'rail-top-positive';
    }
    if (!fallbackSegment) {
      return { entry: currentEntry, segment: currentSegment };
    }
    if (
      currentEntry &&
      currentEntry.segmentType === 'rail' &&
      currentEntry.railInfo &&
      ((fallbackSegment.includes('negative') && currentEntry.railInfo.polarity === 'negative') ||
        (fallbackSegment.includes('positive') && currentEntry.railInfo.polarity === 'positive'))
    ) {
      return { entry: currentEntry, segment: currentSegment };
    }
    const fallbackKey = makeSegmentColumnKey(fallbackSegment, column);
    const fallbackEntry = layout?.targetsBySegmentColumn?.get(fallbackKey);
    if (fallbackEntry) {
      return { entry: fallbackEntry, segment: fallbackSegment };
    }
    return { entry: currentEntry, segment: currentSegment };
  };

  const getSocketPosition = (socket) => {
    const pos = socket?.position || {};
    return {
      x: typeof pos.x === 'number' ? pos.x : 0,
      y: typeof pos.y === 'number' ? pos.y : 0
    };
  };

  const quantizeValue = (value, step) => {
    if (!Number.isFinite(value) || !Number.isFinite(step) || step <= 0) {
      return value;
    }
    return Math.round(value / step) * step;
  };

  const buildRowPositionMap = ({
    rows,
    column,
    socketNode,
    socketIds = [],
    holePositionById = null
  }) => {
    const normalizedRows = Array.isArray(rows) && rows.length > 0
      ? rows
      : Array.isArray(socketNode?.data?.rows)
      ? socketNode.data.rows
      : [];
    const rowPositions = new Map();
    const basePosition = getSocketPosition(socketNode);
    const height =
      typeof socketNode?.height === 'number'
        ? socketNode.height
        : typeof socketNode?.data?.height === 'number'
        ? socketNode.data.height
        : null;
    const spacing =
      normalizedRows.length > 0 && Number.isFinite(height) && height > 0
        ? height / normalizedRows.length
        : null;
    normalizedRows.forEach((rowName, index) => {
      const normalizedRow = normalizeRowName(rowName) || null;
      if (!normalizedRow) return;
      const holeId =
        socketIds[index] ||
        `${normalizedRow}${Number.isFinite(column) ? column : ''}`;
      const precisePosition = holePositionById?.get(holeId);
      if (precisePosition) {
        const px = typeof precisePosition.x === 'number' ? precisePosition.x : basePosition.x;
        const py = typeof precisePosition.y === 'number' ? precisePosition.y : basePosition.y;
        rowPositions.set(normalizedRow, { x: px, y: py });
        return;
      }
      if (spacing !== null) {
        const startY = basePosition.y - height / 2 + spacing / 2;
        rowPositions.set(normalizedRow, {
          x: basePosition.x,
          y: startY + spacing * index
        });
      } else {
        rowPositions.set(normalizedRow, { x: basePosition.x, y: basePosition.y });
      }
    });
    return rowPositions;
  };

  const buildLayoutFromSchema = (schema, socketNodes, railNodes = []) => {
    if (!schema || typeof schema !== 'object') return null;
    const socketNodeById = new Map(Array.isArray(socketNodes) ? socketNodes.map(node => [node.id, node]) : []);
    const railNodeById = new Map(Array.isArray(railNodes) ? railNodes.map(node => [node.id, node]) : []);
    const targetsBySegmentColumn = new Map();
    const columnCenters = new Map();
    const holePositionById = new Map();
    if (Array.isArray(schema.sockets)) {
      schema.sockets.forEach(hole => {
        if (!hole) return;
        const holeId = hole.id || (hole.row && hole.column ? `${hole.row}${hole.column}` : null);
        if (!holeId) return;
        const pos = hole.position || {};
        holePositionById.set(String(holeId), {
          x: typeof pos.x === 'number' ? pos.x : 0,
          y: typeof pos.y === 'number' ? pos.y : 0
        });
      });
    }
    let minColumn = Infinity;
    let maxColumn = -Infinity;
    let topYSum = 0;
    let topCount = 0;
    let bottomYSum = 0;
    let bottomCount = 0;
    let rowSpacingSum = 0;
    let rowSpacingCount = 0;

    const recordRowSpacing = (rowPositions) => {
      if (!rowPositions || rowPositions.size < 2) return;
      let previous = null;
      rowPositions.forEach((pos) => {
        if (previous && Number.isFinite(previous.y) && Number.isFinite(pos.y)) {
          const diff = Math.abs(pos.y - previous.y);
          if (diff > 0.0001) {
            rowSpacingSum += diff;
            rowSpacingCount += 1;
          }
        }
        previous = pos;
      });
    };

    const registerColumnStats = (column, x, segmentName, y) => {
      if (Number.isFinite(column) && Number.isFinite(x)) {
        if (columnCenters.has(column)) {
          const prev = columnCenters.get(column);
          columnCenters.set(column, (prev + x) / 2);
        } else {
          columnCenters.set(column, x);
        }
      }
      if (!Number.isFinite(y)) return;
      if (segmentName === ROW_SEGMENT_TOP) {
        topYSum += y;
        topCount += 1;
      } else if (segmentName === ROW_SEGMENT_BOTTOM) {
        bottomYSum += y;
        bottomCount += 1;
      }
    };

    const schemaSegments = Array.isArray(schema.segments) ? schema.segments : [];
    schemaSegments.forEach(segmentEntry => {
      const column = Number(segmentEntry?.column);
      const segmentName = normalizeSegmentName(segmentEntry?.segment);
      if (!Number.isFinite(column) || !segmentName) return;
      const socketNode = socketNodeById.get(segmentEntry?.nodeId);
      if (!socketNode) return;
      minColumn = Math.min(minColumn, column);
      maxColumn = Math.max(maxColumn, column);
      const socketHandleKey = pickInputHandleKey(socketNode, ['socket', 'in']) || null;
      const rows = Array.isArray(segmentEntry?.rows)
        ? segmentEntry.rows
        : Array.isArray(socketNode?.data?.rows)
        ? socketNode.data.rows
        : [];
      const socketIds = Array.isArray(segmentEntry?.socketIds)
        ? segmentEntry.socketIds
        : rows.map(row => `${row}${column}`);
      const rowPositions = buildRowPositionMap({
        rows,
        column,
        socketNode,
        socketIds,
        holePositionById
      });
      recordRowSpacing(rowPositions);
      const key = makeSegmentColumnKey(segmentName, column);
      targetsBySegmentColumn.set(key, {
        node: socketNode,
        targetHandle: socketHandleKey,
        segmentType: 'socket',
        rowPositions
      });
      const posX = Number(segmentEntry?.position?.x);
      const posY = Number(segmentEntry?.position?.y);
      if (Number.isFinite(posX) || Number.isFinite(posY)) {
        registerColumnStats(column, Number.isFinite(posX) ? posX : getSocketPosition(socketNode).x, segmentName, Number.isFinite(posY) ? posY : getSocketPosition(socketNode).y);
      } else {
        const fallbackPos = getSocketPosition(socketNode);
        registerColumnStats(column, fallbackPos.x, segmentName, fallbackPos.y);
      }
    });

    const schemaRails = Array.isArray(schema.rails) ? schema.rails : [];
    schemaRails.forEach(railEntry => {
      const railIdRaw = typeof railEntry?.id === 'string' ? railEntry.id : `rail-${railEntry?.channel || 'channel'}-${railEntry?.polarity || 'rail'}`;
      const railSegmentKey = railIdRaw.startsWith('rail-') ? railIdRaw : `rail-${railIdRaw}`;
      const preferredHandle = railEntry?.polarity === 'negative' ? 'negative' : 'positive';
      const railSegments = Array.isArray(railEntry?.segments) ? railEntry.segments : [];
      railSegments.forEach(segmentEntry => {
        const column = Number(segmentEntry?.column);
        if (!Number.isFinite(column)) return;
        const railNode = railNodeById.get(segmentEntry?.nodeId);
        if (!railNode) return;
        minColumn = Math.min(minColumn, column);
        maxColumn = Math.max(maxColumn, column);
        const handlePreference = segmentEntry?.handle || preferredHandle;
        const resolvedHandle = pickInputHandleKey(railNode, [handlePreference]) || handlePreference;
        const key = makeSegmentColumnKey(railSegmentKey, column);
        targetsBySegmentColumn.set(key, {
          node: railNode,
          targetHandle: resolvedHandle,
          segmentType: 'rail',
          railInfo: railEntry
        });
        const posX = Number(segmentEntry?.position?.x);
        if (Number.isFinite(posX) && !columnCenters.has(column)) {
          columnCenters.set(column, posX);
        }
      });
    });

    if (!Number.isFinite(minColumn) || !Number.isFinite(maxColumn) || columnCenters.size === 0) {
      return null;
    }

    const boardMidY =
      topCount > 0 && bottomCount > 0 ? (topYSum / topCount + bottomYSum / bottomCount) / 2 : null;
    let columnSpacing = null;
    const sortedColumns = Array.from(columnCenters.entries()).sort((a, b) => a[0] - b[0]);
    if (sortedColumns.length > 1) {
      let spacingSum = 0;
      for (let i = 1; i < sortedColumns.length; i += 1) {
        const prev = sortedColumns[i - 1][1];
        const curr = sortedColumns[i][1];
        if (Number.isFinite(prev) && Number.isFinite(curr)) {
          spacingSum += Math.abs(curr - prev);
        }
      }
      columnSpacing = spacingSum / (sortedColumns.length - 1);
    }
    const rowSpacing = rowSpacingCount > 0 ? rowSpacingSum / rowSpacingCount : null;

    return {
      targetsBySegmentColumn,
      columnCenters,
      minColumn,
      maxColumn,
      boardMidY,
      columnSpacing,
      rowSpacing
    };
  };

  const buildSocketLayout = (socketNodes, railNodes = [], boardSchema = null) => {
    if (boardSchema && typeof boardSchema === 'object') {
      const layout = buildLayoutFromSchema(boardSchema, socketNodes, railNodes);
      if (layout) return layout;
    }
    if ((!Array.isArray(socketNodes) || socketNodes.length === 0) && (!Array.isArray(railNodes) || railNodes.length === 0)) {
      return null;
    }
    const targetsBySegmentColumn = new Map();
    const columnCenters = new Map();
    const columnTotals = new Map();
    let minColumn = Infinity;
    let maxColumn = -Infinity;
    let topYSum = 0;
    let topCount = 0;
    let bottomYSum = 0;
    let bottomCount = 0;
    let rowSpacingSum = 0;
    let rowSpacingCount = 0;

    const recordRowSpacing = (rowPositions) => {
      if (!rowPositions || rowPositions.size < 2) return;
      let previous = null;
      rowPositions.forEach((pos) => {
        if (previous && Number.isFinite(previous.y) && Number.isFinite(pos.y)) {
          const diff = Math.abs(pos.y - previous.y);
          if (diff > 0.0001) {
            rowSpacingSum += diff;
            rowSpacingCount += 1;
          }
        }
        previous = pos;
      });
    };

    const registerTarget = (segment, column, entry) => {
      if (!segment || !Number.isFinite(column) || !entry?.node) return;
      targetsBySegmentColumn.set(makeSegmentColumnKey(segment, column), entry);
    };

    socketNodes.forEach(socket => {
      const column = Number(socket?.data?.column);
      const segment = normalizeSegmentName(socket?.data?.segment);
      if (!Number.isFinite(column) || !segment) return;
      minColumn = Math.min(minColumn, column);
      maxColumn = Math.max(maxColumn, column);
      const socketHandleKey = pickInputHandleKey(socket, ['socket', 'in']);
      if (!socketHandleKey) {
        console.warn('[BreadboardAutoWire]', `Socket node ${socket.id} is missing an input handle; edges may fail.`);
      }
      const rowPositions = buildRowPositionMap({
        rows: socket?.data?.rows,
        column,
        socketNode: socket
      });
      recordRowSpacing(rowPositions);
      registerTarget(segment, column, {
        node: socket,
        targetHandle: socketHandleKey || null,
        segmentType: 'socket',
        rowPositions
      });

      const pos = getSocketPosition(socket);
      const meta = columnTotals.get(column) || { sum: 0, count: 0 };
      meta.sum += pos.x;
      meta.count += 1;
      columnTotals.set(column, meta);
      if (segment === ROW_SEGMENT_TOP) {
        topYSum += pos.y;
        topCount += 1;
      } else if (segment === ROW_SEGMENT_BOTTOM) {
        bottomYSum += pos.y;
        bottomCount += 1;
      }
    });

    const allRailNodes = Array.isArray(railNodes) ? railNodes : [];
    allRailNodes.forEach(rail => {
      const column = Number(rail?.data?.column);
      if (!Number.isFinite(column)) return;
      minColumn = Math.min(minColumn, column);
      maxColumn = Math.max(maxColumn, column);
      const pos = getSocketPosition(rail);
      const meta = columnTotals.get(column) || { sum: 0, count: 0 };
      meta.sum += pos.x;
      meta.count += 1;
      columnTotals.set(column, meta);
      const rails = Array.isArray(rail?.data?.rails) ? rail.data.rails : [];
      rails.forEach(railInfo => {
        const channel = String(rail?.data?.channel || '').toLowerCase();
        const polarity = String(railInfo?.polarity || '').toLowerCase();
        const railId = String(railInfo?.railId || `rail-${channel || 'channel'}-${polarity || 'rail'}`).trim().toLowerCase();
        const segment = railId.startsWith('rail-') ? railId : `rail-${railId}`;
        const targetHandle = polarity === 'negative' ? 'negative' : 'positive';
        const preferredKeys =
          targetHandle === 'negative'
            ? [targetHandle, 'gnd', 'ground', 'negative']
            : [targetHandle, 'vplus', 'positive', 'rail'];
        const resolvedHandle = pickInputHandleKey(rail, preferredKeys) || targetHandle;
        if (!resolvedHandle) {
          console.warn('[BreadboardAutoWire]', `Rail node ${rail.id} is missing an input handle for ${targetHandle}.`);
        }
        registerTarget(segment, column, {
          node: rail,
          targetHandle: resolvedHandle || targetHandle,
          segmentType: 'rail',
          railInfo,
          channel,
          polarity
        });
      });
    });

    columnTotals.forEach((meta, column) => {
      if (meta.count > 0) {
        columnCenters.set(column, meta.sum / meta.count);
      }
    });

    if (!Number.isFinite(minColumn) || !Number.isFinite(maxColumn) || columnCenters.size === 0) {
      return null;
    }

    const boardMidY =
      topCount > 0 && bottomCount > 0
        ? (topYSum / topCount + bottomYSum / bottomCount) / 2
        : null;
    let columnSpacing = null;
    const sortedColumns = Array.from(columnCenters.entries()).sort((a, b) => a[0] - b[0]);
    if (sortedColumns.length > 1) {
      let spacingSum = 0;
      for (let i = 1; i < sortedColumns.length; i += 1) {
        const prev = sortedColumns[i - 1][1];
        const curr = sortedColumns[i][1];
        if (Number.isFinite(prev) && Number.isFinite(curr)) {
          spacingSum += Math.abs(curr - prev);
        }
      }
      columnSpacing = spacingSum / (sortedColumns.length - 1);
    }
    const rowSpacing = rowSpacingCount > 0 ? rowSpacingSum / rowSpacingCount : null;

    return {
      targetsBySegmentColumn,
      columnCenters,
      minColumn,
      maxColumn,
      boardMidY,
      columnSpacing,
      rowSpacing
    };
  };

  const findNearestColumn = (x, columnCenters) => {
    if (!Number.isFinite(x) || !(columnCenters instanceof Map)) return null;
    let bestColumn = null;
    let bestDist = Infinity;
    columnCenters.forEach((centerX, column) => {
      const dist = Math.abs(centerX - x);
      if (dist < bestDist) {
        bestDist = dist;
        bestColumn = column;
      }
    });
    return bestColumn;
  };

  const determineAnchor = (node, layout) => {
    const fallback = {
      segment: ROW_SEGMENT_TOP,
      column: layout?.minColumn || 1
    };
    if (!node || !layout) return fallback;
    const pos = node.position || {};
    const x = typeof pos.x === 'number' ? pos.x : null;
    const y = typeof pos.y === 'number' ? pos.y : null;

    const anchorColumn = clampColumn(
      Number.isFinite(x) ? findNearestColumn(x, layout.columnCenters) ?? fallback.column : fallback.column,
      layout.minColumn,
      layout.maxColumn
    );

    let anchorSegment = ROW_SEGMENT_TOP;
    if (Number.isFinite(y)) {
      const topSocketEntry = layout.targetsBySegmentColumn.get(makeSegmentColumnKey(ROW_SEGMENT_TOP, anchorColumn));
      const bottomSocketEntry = layout.targetsBySegmentColumn.get(makeSegmentColumnKey(ROW_SEGMENT_BOTTOM, anchorColumn));
      const topSocket = topSocketEntry?.node;
      const bottomSocket = bottomSocketEntry?.node;
      const topY = topSocket ? getSocketPosition(topSocket).y : null;
      const bottomY = bottomSocket ? getSocketPosition(bottomSocket).y : null;
      if (topY !== null && bottomY !== null) {
        const distTop = Math.abs(y - topY);
        const distBottom = Math.abs(y - bottomY);
        anchorSegment = distBottom < distTop ? ROW_SEGMENT_BOTTOM : ROW_SEGMENT_TOP;
      } else if (topY !== null) {
        anchorSegment = y >= topY ? ROW_SEGMENT_BOTTOM : ROW_SEGMENT_TOP;
      } else if (bottomY !== null) {
        anchorSegment = y >= bottomY ? ROW_SEGMENT_BOTTOM : ROW_SEGMENT_TOP;
      } else if (Number.isFinite(layout.boardMidY)) {
        anchorSegment = y >= layout.boardMidY ? ROW_SEGMENT_BOTTOM : ROW_SEGMENT_TOP;
      }
    }

    return {
      segment: anchorSegment,
      column: anchorColumn
    };
  };

  const normalizePinsForNode = (pins = []) => {
    if (!Array.isArray(pins) || pins.length === 0) return [];
    let baseColumn = null;
    pins.forEach(pin => {
      if (baseColumn !== null) return;
      const col = Number(pin?.column);
      if (Number.isFinite(col)) baseColumn = col;
    });
    if (baseColumn === null) baseColumn = 1;

    return pins.map((pin, index) => {
      const columnOffset = Number.isFinite(pin?.columnOffset)
        ? Number(pin.columnOffset)
        : Number.isFinite(pin?.column)
        ? Number(pin.column) - baseColumn
        : index;
      const preferenceSource =
        pin?.segmentPreference !== undefined
          ? pin.segmentPreference
          : pin?.segment !== undefined
          ? pin.segment
          : null;
      const segmentPreference = normalizeSegmentPreference(preferenceSource || 'same');
      const handleKey = pin?.handleKey || pin?.key || pin?.id || pin?.label;
      return {
        columnOffset,
        segmentPreference,
        handleKey,
        originalPin: pin || {},
        index
      };
    });
  };

  const deriveSocketKey = (socket, rowHint) => {
    if (!socket) return null;
    const column = socket?.data?.column;
    const rows = Array.isArray(socket?.data?.rows) ? socket.data.rows : [];
    const row = rowHint || rows[0];
    if (row && Number.isFinite(column)) {
      return `${String(row).trim().toUpperCase()}${column}`;
    }
    return socket.id || null;
  };

  const chooseSocketRow = (socket, segment, rowPositions, preferredRow) => {
    if (isRailSegment(segment)) {
      const normalizedPreferred = normalizeRowName(preferredRow);
      if (normalizedPreferred) return normalizedPreferred;
      return getRailRowLabel(segment) || SEGMENT_ROW_FALLBACK[ROW_SEGMENT_TOP];
    }
    const normalizedPreferred = normalizeRowName(preferredRow);
    if (normalizedPreferred) {
      if (rowPositions?.has(normalizedPreferred)) {
        return normalizedPreferred;
      }
      const availableRows = Array.isArray(socket?.data?.rows)
        ? socket.data.rows.map(normalizeRowName)
        : [];
      if (availableRows.includes(normalizedPreferred)) {
        return normalizedPreferred;
      }
    }
    if (rowPositions && rowPositions.size > 0) {
      const iterator = rowPositions.keys().next();
      if (!iterator.done) return iterator.value;
    }
    const rows = Array.isArray(socket?.data?.rows) ? socket.data.rows : [];
    if (rows.length > 0) return normalizeRowName(rows[0]) || rows[0];
    return SEGMENT_ROW_FALLBACK[segment] || SEGMENT_ROW_FALLBACK[ROW_SEGMENT_TOP];
  };

  const normalizeHandleEntry = (handle) => {
    if (!handle) return null;
    if (typeof handle === 'string') {
      return { id: handle, key: handle, label: handle };
    }
    if (typeof handle !== 'object') return null;
    const id = handle.id || handle.key || handle.name || handle.handleKey;
    if (!id) return null;
    return {
      id,
      key: handle.key || id,
      label: handle.label || handle.name || id,
      type: handle.type || handle.dataType || handle.handleType || 'value'
    };
  };

  const hasHandleOnNode = (node, handleKey) => {
    if (!node || !handleKey) return null;
    const sources = [node.handles, node.outputs, node.inputs, node.data?.handles];
    const normalized = [];
    sources.forEach(list => {
      if (!Array.isArray(list)) return;
      list.forEach(entry => {
        const normalizedEntry = normalizeHandleEntry(entry);
        if (normalizedEntry) normalized.push(normalizedEntry);
      });
    });
    return normalized.find(handle => handle.id === handleKey || handle.key === handleKey) || null;
  };

  const pickInputHandleKey = (node, preferredKeys = []) => {
    if (!node) return null;
    const collected = [];
    const seen = new Set();

    const addEntries = (entries, forceInput = false) => {
      if (!Array.isArray(entries)) return;
      entries.forEach(entry => {
        if (!entry) return;
        const normalized = normalizeHandleEntry(entry);
        if (!normalized) return;
        const rawDirection = (entry.direction || entry.handleDirection || entry.type || '').toString().toLowerCase();
        const isInputLike =
          forceInput ||
          !rawDirection ||
          rawDirection === 'input' ||
          rawDirection === 'bidirectional';
        if (!isInputLike) return;
        const key = normalized.key || normalized.id;
        if (!key || seen.has(key)) return;
        seen.add(key);
        collected.push(key);
      });
    };

    addEntries(node.inputs, true);
    addEntries(node.handles, false);
    if (node.data && Array.isArray(node.data.handles)) {
      addEntries(node.data.handles, false);
    }

    for (const preferred of preferredKeys) {
      if (!preferred) continue;
      const exact = collected.find(key => key === preferred);
      if (exact) return exact;
      const caseInsensitive = collected.find(key => key.toLowerCase() === String(preferred).toLowerCase());
      if (caseInsensitive) return caseInsensitive;
    }

    if (collected.length > 0) {
      return collected[0];
    }

    return DEFAULT_INPUT_HANDLE_KEY;
  };

  const extractNodeIds = (payload) => {
    if (!payload || typeof payload !== 'object') return [];
    const arraysToCheck = [payload.nodeIds, payload.nodes, payload.details && payload.details.nodeIds];
    for (const arr of arraysToCheck) {
      if (Array.isArray(arr)) {
        return arr
          .map(item => {
            if (typeof item === 'string' || typeof item === 'number') return String(item);
            if (item && typeof item === 'object' && (item.id || item.nodeId)) {
              return String(item.id || item.nodeId);
            }
            return null;
          })
          .filter(Boolean);
      }
    }
    const candidates = [payload.nodeId, payload.id, payload.details && payload.details.nodeId, payload.node && payload.node.id];
    return candidates
      .filter(value => typeof value === 'string' || typeof value === 'number')
      .map(value => String(value));
  };

  const pendingDragEndNodeIds = new Set();
  let dragEndProcessingScheduled = false;
  const scheduleDragEndProcessing = (processFn) => {
    if (dragEndProcessingScheduled) return;
    dragEndProcessingScheduled = true;
    const flush = () => {
      dragEndProcessingScheduled = false;
      if (pendingDragEndNodeIds.size === 0) return;
      const ids = Array.from(pendingDragEndNodeIds);
      pendingDragEndNodeIds.clear();
      try {
        const maybePromise = processFn(ids);
        if (maybePromise && typeof maybePromise.then === 'function') {
          maybePromise.catch(err => console.error('[BreadboardAutoWire] Failed to process drag end queue:', err));
        }
      } catch (err) {
        console.error('[BreadboardAutoWire] Failed to process drag end queue:', err);
      }
    };
    if (typeof window.requestAnimationFrame === 'function') {
      window.requestAnimationFrame(() => {
        window.requestAnimationFrame(flush);
      });
    } else {
      setTimeout(flush, 0);
    }
  };

  const readInitialDebugPreference = () => {
    if (typeof window.__breadboardAutoWireDebug === 'boolean') {
      return window.__breadboardAutoWireDebug;
    }
    if (window.__breadboardAutoWireDebug !== undefined) {
      return Boolean(window.__breadboardAutoWireDebug);
    }
    try {
      const stored = window.localStorage?.getItem('breadboardAutoWireDebug');
      if (stored === 'true') return true;
      if (stored === 'false') return false;
    } catch (err) {
      /* ignore */
    }
    return false;
  };

  const initialDebugPreference = readInitialDebugPreference();
  const isDebugEnabled = () => {
    if (typeof window.__breadboardAutoWireDebug === 'boolean') {
      return window.__breadboardAutoWireDebug;
    }
    if (window.__breadboardAutoWireDebug !== undefined) {
      return Boolean(window.__breadboardAutoWireDebug);
    }
    return initialDebugPreference;
  };

  const debugLog = (...args) => {
    if (!isDebugEnabled()) return;
    console.info('[BreadboardAutoWire]', ...args);
  };

  const setDebugPreference = (value) => {
    const normalized = Boolean(value);
    window.__breadboardAutoWireDebug = normalized;
    try {
      window.localStorage?.setItem('breadboardAutoWireDebug', normalized ? 'true' : 'false');
    } catch (err) {
      /* ignore */
    }
    console.info('[BreadboardAutoWire]', `Debug logging ${normalized ? 'enabled' : 'disabled'}`);
  };

  window.breadboardAutoWire = window.breadboardAutoWire || {};
  if (typeof window.breadboardAutoWire.setDebug !== 'function') {
    window.breadboardAutoWire.setDebug = setDebugPreference;
  }

  const connectAdjacency = (adjacency, a, b) => {
    if (!a || !b) return;
    if (!adjacency.has(a)) adjacency.set(a, new Set());
    adjacency.get(a).add(b);
  };

  const solveConnectivity = (nodes = [], edges = []) => {
    const adjacency = new Map();

    edges.forEach(edge => {
      if (!edge || !edge.source || !edge.target) return;
      const sourceHandle = edge.sourceHandle || DEFAULT_INPUT_HANDLE_KEY;
      const sourceId = makeHandleNodeId(edge.source, sourceHandle);
      const targetId =
        edge.targetHandle && edge.targetHandle !== 'socket'
          ? makeHandleNodeId(edge.target, edge.targetHandle)
          : edge.target;
      connectAdjacency(adjacency, sourceId, targetId);
      connectAdjacency(adjacency, targetId, sourceId);
    });

    nodes.forEach(node => {
      const pairs = CONDUCTIVE_COMPONENTS[node?.type];
      if (!node || !Array.isArray(pairs)) return;
      pairs.forEach(pair => {
        if (!Array.isArray(pair) || pair.length < 2) return;
        const [fromKey, toKey] = pair;
        const fromId = makeHandleNodeId(node.id, fromKey);
        const toId = makeHandleNodeId(node.id, toKey);
        connectAdjacency(adjacency, fromId, toId);
        connectAdjacency(adjacency, toId, fromId);
      });
    });

    const nodeFlags = new Map();
    const markReachable = (startId, flagKey) => {
      if (!startId) return;
      const visited = new Set();
      const queue = [startId];
      visited.add(startId);
      while (queue.length > 0) {
        const current = queue.shift();
        if (!nodeFlags.has(current)) nodeFlags.set(current, {});
        nodeFlags.get(current)[flagKey] = true;
        const neighbors = adjacency.get(current);
        if (!neighbors) continue;
        neighbors.forEach(nextId => {
          if (visited.has(nextId)) return;
          visited.add(nextId);
          queue.push(nextId);
        });
      }
    };

    nodes.forEach(node => {
      if (!node || node.type !== 'io.breadboard.bus') return;
      const positiveId = makeHandleNodeId(node.id, 'positive');
      const negativeId = makeHandleNodeId(node.id, 'negative');
      markReachable(positiveId, 'touchesVPlus');
      markReachable(negativeId, 'touchesGnd');
    });

    return nodeFlags;
  };

  const waitForGraphSettled = () =>
    new Promise(resolve => {
      if (typeof window.requestAnimationFrame === 'function') {
        window.requestAnimationFrame(() => window.requestAnimationFrame(resolve));
      } else {
        setTimeout(resolve, 16);
      }
    });

  const toPromise = (value) => {
    if (value && typeof value.then === 'function') {
      return value;
    }
    return Promise.resolve(value);
  };

  const readGraphSnapshot = (api) => {
    const nodesResult = api.readNode?.();
    const edgesResult = api.readEdge?.();
    return {
      nodes: Array.isArray(nodesResult?.data) ? nodesResult.data : [],
      edges: Array.isArray(edgesResult?.data) ? edgesResult.data : []
    };
  };

  const readBoardSchemaFromNodes = (nodes = []) => {
    if (typeof window !== 'undefined' && isPlainObject(window.__breadboardSchema)) {
      return window.__breadboardSchema;
    }
    if (!Array.isArray(nodes)) return null;
    const skinNode = nodes.find(node => node?.type === 'io.breadboard.sockets:skin');
    const schema =
      (skinNode?.data && skinNode.data.schema) ||
      (skinNode?.data?.breadboard && skinNode.data.breadboard.schema);
    if (isPlainObject(schema)) {
      if (typeof window !== 'undefined') {
        window.__breadboardSchema = schema;
      }
      return schema;
    }
    return null;
  };

  const attemptAttach = () => {
    const eventBus = window.eventBus;
    const api = window.graphAPI;
    if (!eventBus || !api || typeof api.readNode !== 'function' || typeof api.updateNode !== 'function') {
      setTimeout(attemptAttach, 500);
      return;
    }
    if (attemptAttach._attached) return;
    attemptAttach._attached = true;

    const cleanupCallbacks = [];
    const registerCleanup = (fn) => {
      if (typeof fn === 'function') cleanupCallbacks.push(fn);
    };

    const collectHandleKeys = (node) => {
      const keys = new Set();
      if (Array.isArray(node?.handles)) {
        node.handles.forEach(handle => {
          if (handle?.id) keys.add(handle.id);
        });
      }
      if (Array.isArray(node?.outputs)) {
        node.outputs.forEach(handle => {
          if (handle?.key) keys.add(handle.key);
        });
      }
      if (Array.isArray(node?.inputs)) {
        node.inputs.forEach(handle => {
          if (handle?.key) keys.add(handle.key);
        });
      }
      if (Array.isArray(node?.data?.pins)) {
        node.data.pins.forEach(pin => {
          if (pin?.id) keys.add(pin.id);
        });
      }
      return Array.from(keys);
    };

    const updateConnectivityStates = async () => {
      const snapshot = readGraphSnapshot(api);
      if (!snapshot) return;
      const handleFlags = solveConnectivity(snapshot.nodes, snapshot.edges);
      for (const node of snapshot.nodes) {
        const existingPinState = isPlainObject(node.data?.breadboard?.pinState)
          ? node.data.breadboard.pinState
          : {};
        let changed = false;
        const nextPinState = { ...existingPinState };
        const pinKeys = collectHandleKeys(node);
        pinKeys.forEach(handleKey => {
          if (!handleKey) return;
          const currentState = nextPinState[handleKey] || {};
          const flagEntry = handleFlags.get(makeHandleNodeId(node.id, handleKey)) || {};
          const touchesVPlus = Boolean(flagEntry.touchesVPlus);
          const touchesGnd = Boolean(flagEntry.touchesGnd);
          nextPinState[handleKey] = {
            ...currentState,
            touchesVPlus,
            touchesGnd
          };
          if ((currentState.touchesVPlus || false) !== touchesVPlus || (currentState.touchesGnd || false) !== touchesGnd) {
            changed = true;
          }
        });
        if (!changed) continue;
        const payload = {
          data: {
            ...node.data,
            breadboard: {
              ...(isPlainObject(node.data?.breadboard) ? node.data.breadboard : {}),
              pinState: nextPinState
            }
          }
        };
        try {
          await toPromise(api.updateNode(node.id, payload));
          if (eventBus && typeof eventBus.emit === 'function') {
            eventBus.emit('breadboard.pinStateChanged', {
              nodeId: node.id,
              pinState: nextPinState,
              source: 'breadboard-auto-wire'
            });
          }
        } catch (err) {
          console.warn('[BreadboardAutoWire]', 'Failed to update node with connectivity state:', node.id, err);
        }
      }
    };

    const handleNodeDragStart = () => {};

    const processNodeDragEnd = async (queuedNodeIds = []) => {
      if (!Array.isArray(queuedNodeIds) || queuedNodeIds.length === 0) return;

      const { nodes, edges } = readGraphSnapshot(api);
      const socketNodes = nodes.filter(node => node?.type === 'io.breadboard.sockets:socket');
      const railNodes = nodes.filter(node => node?.type === 'io.breadboard.sockets:railSocket');
      if (socketNodes.length === 0 && railNodes.length === 0) return;

      const boardSchema = readBoardSchemaFromNodes(nodes);
      const layout = buildSocketLayout(socketNodes, railNodes, boardSchema);
      if (!layout) return;

      const connectableNodes = socketNodes.concat(railNodes);
      const connectableNodeById = new Map(connectableNodes.map(node => [node.id, node]));
      const connectableNodeIds = new Set(connectableNodeById.keys());

      const deleteEdgeById = async (edgeId, context) => {
        if (!edgeId || typeof api.deleteEdge !== 'function') return;
        try {
          const result = await toPromise(api.deleteEdge(edgeId));
          if (!result?.success) {
            console.warn(
              '[BreadboardAutoWire]',
              `Failed to delete edge ${edgeId}${context ? ` (${context})` : ''}:`,
              result?.error || 'unknown error'
            );
          }
        } catch (err) {
          console.warn('[BreadboardAutoWire]', `Failed to delete edge ${edgeId}${context ? ` (${context})` : ''}:`, err);
        }
      };

      const collectConnectableEdges = (nodeId) => {
        if (!nodeId) return [];
        const snapshot = typeof api.readEdge === 'function' ? api.readEdge() : null;
        const edges = Array.isArray(snapshot?.data) ? snapshot.data : [];
        return edges.filter(edge => edge?.source === nodeId && connectableNodeIds.has(edge.target));
      };

      const describeTargetLabel = (edge) => {
        const targetNode = connectableNodeById.get(edge?.target);
        if (!targetNode) return edge?.target || 'unknown';
        if (targetNode.type === 'io.breadboard.sockets:socket') {
          const segment = normalizeSegmentName(targetNode?.data?.segment);
          const socketRow = chooseSocketRow(targetNode, segment, null, null);
          return deriveSocketKey(targetNode, socketRow) || targetNode.label || targetNode.id;
        }
        if (targetNode.type === 'io.breadboard.sockets:railSocket') {
          const column = targetNode?.data?.column;
          const rowLabel = edge?.targetHandle === 'negative' ? 'GND' : 'V+';
          if (Number.isFinite(column)) {
            return `${rowLabel}${column}`;
          }
          return `${rowLabel} (${targetNode.label || targetNode.id})`;
        }
        return targetNode.label || targetNode.id;
      };

      const summarizeSocketEdges = (nodeId, label) => {
        const summaries = collectConnectableEdges(nodeId).map(edge => {
          const socketLabel = describeTargetLabel(edge);
          return `${edge.sourceHandle || 'unknown'}${socketLabel}`;
        });
        console.info('[BreadboardAutoWire]', `${label} edges for ${nodeId}:`, summaries.length > 0 ? summaries.join(', ') : 'none');
        return summaries;
      };

      const verificationTimers = new Map();
      const scheduleEdgeVerification = (node, desiredMappings) => {
        if (!node || !node.id || !desiredMappings || desiredMappings.size === 0) return;
        const nodeId = node.id;
        if (verificationTimers.has(nodeId)) {
          clearTimeout(verificationTimers.get(nodeId));
        }
        const runVerification = async () => {
          verificationTimers.delete(nodeId);
          await waitForGraphSettled();
          const currentEdges = collectConnectableEdges(nodeId);
          const edgesByHandle = new Map();
          currentEdges.forEach(edge => {
            if (!edge || !edge.sourceHandle) return;
            if (!edgesByHandle.has(edge.sourceHandle)) {
              edgesByHandle.set(edge.sourceHandle, []);
            }
            edgesByHandle.get(edge.sourceHandle).push(edge);
          });

          for (const [handleKey, desired] of desiredMappings.entries()) {
            if (!handleKey || !desired) continue;
            const entries = edgesByHandle.get(handleKey) || [];
            let hasMatch = false;
            const desiredTargetHandle = desired.targetHandle || null;
            for (const edge of entries) {
              const edgeTargetHandle = edge?.targetHandle || null;
              const handleMatches = desiredTargetHandle ? edgeTargetHandle === desiredTargetHandle : true;
              if (edge.target === desired.socketId && handleMatches && !hasMatch) {
                hasMatch = true;
              } else {
                await deleteEdgeById(edge.id, 'verify');
              }
            }
            if (!hasMatch && typeof api.createEdge === 'function') {
              console.warn('[BreadboardAutoWire]', `Retry edge for ${node.label || nodeId}.${handleKey}  ${desired.socketKey || desired.socketId}`);
              const edgePayload = {
                source: nodeId,
                sourceHandle: handleKey,
                target: desired.socketId,
                type: 'default'
              };
              if (desired.targetHandle) {
                edgePayload.targetHandle = desired.targetHandle;
              }
              try {
                const result = await toPromise(api.createEdge(edgePayload));
                if (!result?.success) {
                  console.warn('[BreadboardAutoWire]', 'Failed to recreate edge during verification:', result?.error || 'unknown error');
                }
              } catch (err) {
                console.warn('[BreadboardAutoWire]', 'Failed to recreate edge during verification:', err);
              }
            }
          }

          await waitForGraphSettled();
          summarizeSocketEdges(nodeId, 'Verified');
        };

        const timer = setTimeout(() => {
          runVerification().catch((err) => {
            console.warn('[BreadboardAutoWire] Verification task failed:', err);
          });
        }, 32);
        verificationTimers.set(nodeId, timer);
      };

      const rebuildEdgesForNode = async (node, desiredMappings, onSocketTouched) => {
        if (!node || !node.id) return;
        const nodeId = node.id;
        const nodeLabel = node.label || nodeId;
        await waitForGraphSettled();
        summarizeSocketEdges(nodeId, 'Before rebuild');
        const existingEdges = collectConnectableEdges(nodeId);
        for (const edge of existingEdges) {
          const targetLabel = describeTargetLabel(edge);
          console.info('[BreadboardAutoWire]', `Edge removed for ${nodeLabel}.${edge.sourceHandle || 'unknown'} (was ${targetLabel || edge.target})`);
          if (typeof onSocketTouched === 'function' && edge?.target) {
            onSocketTouched(edge.target);
          }
          await deleteEdgeById(edge.id, 'rebuild');
        }
        if (existingEdges.length > 0) {
          await waitForGraphSettled();
        }
        if (!desiredMappings || desiredMappings.size === 0) {
          await waitForGraphSettled();
          summarizeSocketEdges(nodeId, 'After rebuild');
          return;
        }
        for (const [handleKey, desired] of desiredMappings.entries()) {
          if (!handleKey || !desired) continue;
          if (typeof api.createEdge !== 'function') {
            console.warn('[BreadboardAutoWire]', 'graphAPI.createEdge is not available.');
            continue;
          }
          const edgePayload = {
            source: nodeId,
            sourceHandle: handleKey,
            target: desired.socketId,
            type: 'default'
          };
          if (desired.targetHandle) {
            edgePayload.targetHandle = desired.targetHandle;
          }
          let result;
          try {
            result = await toPromise(api.createEdge(edgePayload));
          } catch (err) {
            console.warn('[BreadboardAutoWire]', 'Failed to create edge:', { nodeId, handleKey, target: desired.socketId }, err);
            continue;
          }
          if (!result?.success) {
            console.warn('[BreadboardAutoWire]', 'Failed to create edge:', { nodeId, handleKey, target: desired.socketId }, result?.error || 'unknown error');
            continue;
          }
          console.info('[BreadboardAutoWire]', `Edge added for ${nodeLabel}.${handleKey}  ${desired.socketKey || desired.socketId}`);
        }
        await waitForGraphSettled();
        summarizeSocketEdges(nodeId, 'After rebuild');
        scheduleEdgeVerification(node, desiredMappings);
      };

      const socketConnectionInfo = new Map();
      edges.forEach(edge => {
        if (!edge || !edge.target || edge.targetHandle !== 'socket') return;
        const socketNode = connectableNodeById.get(edge.target);
        if (!socketNode || socketNode.type !== 'io.breadboard.sockets:socket') return;
        const entry = socketConnectionInfo.get(edge.target) || {
          total: 0,
          perNode: new Map()
        };
        entry.total += 1;
        const sourceId = edge.source || '__unknown__';
        entry.perNode.set(sourceId, (entry.perNode.get(sourceId) || 0) + 1);
        socketConnectionInfo.set(edge.target, entry);
      });

      const getSocketPeerCount = (socketId, nodeId) => {
        if (!socketId) return 0;
        const info = socketConnectionInfo.get(socketId);
        if (!info) return 0;
        const ownCount = nodeId ? info.perNode.get(nodeId) || 0 : 0;
        return Math.max(0, info.total - ownCount);
      };

      const getSocketPeerIds = (socketId, excludeId) => {
        if (!socketId) return [];
        const info = socketConnectionInfo.get(socketId);
        if (!info) return [];
        const ids = [];
        info.perNode.forEach((count, nodeId) => {
          if (!nodeId || nodeId === excludeId) return;
          ids.push(nodeId);
        });
        return ids;
      };

      const queuedNodeSet = new Set(queuedNodeIds);

      for (const nodeId of queuedNodeIds) {
        const node = nodes.find(n => n?.id === nodeId);
        if (!node || node.type === 'io.breadboard.sockets:socket') continue;

        const pins = Array.isArray(node.data?.pins) ? node.data.pins.map(pin => ({ ...pin })) : [];
        if (pins.length === 0) {
          debugLog('No pins found for node:', nodeId);
          continue;
        }

        const markPeersForSocket = () => {};
        const normalizedPins = normalizePinsForNode(pins);
        const anchor = determineAnchor(node, layout);
        const columnOffsets = normalizedPins.map(pin =>
          Number.isFinite(pin.columnOffset) ? pin.columnOffset : 0
        );
        const minOffset = columnOffsets.length > 0 ? Math.min(...columnOffsets) : 0;
        const maxOffset = columnOffsets.length > 0 ? Math.max(...columnOffsets) : 0;
        const minAnchorColumn = clampColumn(layout.minColumn - minOffset, layout.minColumn, layout.maxColumn);
        const maxAnchorColumn = clampColumn(layout.maxColumn - maxOffset, layout.minColumn, layout.maxColumn);
        const adjustedAnchorColumn = clampColumn(anchor.column, minAnchorColumn, maxAnchorColumn);
        debugLog('Processing drop for', node.label || node.id, 'anchor:', anchor, 'adjustedColumn:', adjustedAnchorColumn);

        const resolvedPins = [];
        const nextPinState = {};
        const targetPositions = [];
        let pinsChanged = false;

        normalizedPins.forEach((pinInfo, index) => {
          const handleKey = pinInfo.handleKey;
          const handle = hasHandleOnNode(node, handleKey);
          if (!handle) {
            console.warn('[BreadboardAutoWire]', `Handle "${handleKey}" not found on node ${node.label || node.id}.`);
            return;
          }

          const desiredColumn = clampColumn(adjustedAnchorColumn + pinInfo.columnOffset, layout.minColumn, layout.maxColumn);
          let desiredSegment = resolvePinSegment(node, pinInfo, anchor.segment);
          const isGroundTap = node.type === 'io.breadboard.components:railTapNegative' && handle.key === 'tap';
          const socketKey = makeSegmentColumnKey(desiredSegment, desiredColumn);
          let targetEntry = layout.targetsBySegmentColumn.get(socketKey);
          const coerced = coerceRailTarget(targetEntry, desiredSegment, desiredColumn, node, handle.key, layout);
          targetEntry = coerced.entry;
          desiredSegment = coerced.segment;
          if (!targetEntry) {
            debugLog('No socket for', socketKey, 'while dropping', node.label || node.id);
            return;
          }
          const socket = targetEntry.node;
          markPeersForSocket(socket.id);

          const pin = pins[index] || {};
          let preferredRow = pin.row || pinInfo?.originalPin?.row || null;
          if (!preferredRow && Array.isArray(socket?.data?.rows) && socket.data.rows[index]) {
            preferredRow = socket.data.rows[index];
          }
          const socketRow = chooseSocketRow(
            socket,
            desiredSegment,
            targetEntry.rowPositions,
            preferredRow
          );
          const socketIdentifier = deriveSocketKey(socket, socketRow);
          const normalizedRow = normalizeRowName(socketRow);
          const rowPosition =
            (normalizedRow && targetEntry.rowPositions?.get(normalizedRow)) || null;
          resolvedPins.push({
            handle: handle.key,
            socketId: socket.id,
            socketKey: socketIdentifier,
            targetHandle: targetEntry.targetHandle || null,
            pinIndex: index
          });

          const preservedPreference =
            isGroundTap
              ? desiredSegment
              : pin.segmentPreference !== undefined
              ? pin.segmentPreference
              : pinInfo.segmentPreference;
          if (pin.row !== socketRow || pin.column !== desiredColumn || pin.socket !== socketIdentifier) {
            pinsChanged = true;
          }
          pins[index] = {
            ...pin,
            row: socketRow,
            column: desiredColumn,
            segment: desiredSegment,
            segmentPreference: preservedPreference,
            socket: socketIdentifier
          };

          const peerCount = getSocketPeerCount(socket.id, node.id);
          nextPinState[handle.key] = {
            socketId: socket.id,
            socketKey: socketIdentifier,
            segment: desiredSegment,
            column: desiredColumn,
            row: socketRow,
            targetHandle: targetEntry.targetHandle || null,
            peerCount,
            hasPeer: peerCount > 0,
            position: rowPosition || getSocketPosition(socket)
          };

          const socketPos = rowPosition || getSocketPosition(socket);
          targetPositions.push({
            x: socketPos.x,
            y: socketPos.y,
            handle: handle.key,
            segment: desiredSegment
          });
        });

        if (resolvedPins.length === 0) {
          console.info(`[BreadboardAutoWire] Drop processed for ${node.label || node.id}: no matching pins found.`);
          continue;
        }

        const summary = resolvedPins.map(entry => `${entry.handle}${entry.socketKey || entry.socketId}`).join(', ');
        console.info(`[BreadboardAutoWire] Drop processed for ${node.label || node.id}: ${resolvedPins.length} pin(s) connected (${summary}).`);

        const desiredMap = new Map(resolvedPins.map(entry => [entry.handle, entry]));
        await rebuildEdgesForNode(node, desiredMap, markPeersForSocket);

        const existingPinState = node.data?.breadboard?.pinState || {};
        const pinStateChanged =
          JSON.stringify(existingPinState) !== JSON.stringify(nextPinState);

        // Determine where to place the component based purely on the sockets
        // it is actually connected to. No resizing, no layout heuristics.
        let snapPosition = null;

        if (targetPositions.length > 0) {
          const bounds = targetPositions.reduce(
            (acc, curr) => ({
              minX: Math.min(acc.minX, curr.x),
              maxX: Math.max(acc.maxX, curr.x),
              minY: Math.min(acc.minY, curr.y),
              maxY: Math.max(acc.maxY, curr.y)
            }),
            {
              minX: Infinity,
              maxX: -Infinity,
              minY: Infinity,
              maxY: -Infinity
            }
          );

          // Simple, deterministic rule:
          // place the node at the geometric center of all its pinned sockets.
          snapPosition = {
            x: (bounds.minX + bounds.maxX) / 2,
            y: (bounds.minY + bounds.maxY) / 2
          };
        }

        const needsUpdate =
          pinsChanged || pinStateChanged || Boolean(snapPosition);
        if (!needsUpdate) {
          continue;
        }

        const payload = {};
        if (pinsChanged || pinStateChanged) {
          payload.data = {
            pins,
            breadboard: {
              ...(isPlainObject(node.data?.breadboard)
                ? node.data.breadboard
                : {}),
              pinState: nextPinState
            }
          };
        }

        // Only move the component's center. Do NOT change width/height here.
        if (snapPosition) {
          payload.position = snapPosition;
        }

        api.updateNode(node.id, payload);


        // No peer requeue; connectivity solver updates pin states after all nodes processed.
      }

      await updateConnectivityStates();
    };

    const handleNodeDragEnd = (payload = {}) => {
      const nodeIds = extractNodeIds(payload);
      debugLog('handleNodeDragEnd resolved nodeIds:', nodeIds, 'from payload:', payload);
      if (!Array.isArray(nodeIds) || nodeIds.length === 0) return;
      nodeIds.forEach(id => pendingDragEndNodeIds.add(id));
      scheduleDragEndProcessing(processNodeDragEnd);
    };

    const dragStartEventNames = ['nodeDragStart', 'node:dragstart'];
    const dragEndEventNames = ['nodeDragEnd', 'node:dragend'];
    const normalizedDragStartNames = new Set(dragStartEventNames.map(name => String(name || '').toLowerCase()));
    const normalizedDragEndNames = new Set(dragEndEventNames.map(name => String(name || '').toLowerCase()));
    const normalizeEventName = (name) => (typeof name === 'string' ? name.toLowerCase() : '');

    const subscribeEvents = (eventNames, handler) => {
      if (!eventBus?.on || !Array.isArray(eventNames)) return;
      eventNames.forEach(eventName => {
        if (typeof eventName === 'string') {
          eventBus.on(eventName, handler);
          registerCleanup(() => eventBus.off(eventName, handler));
        }
      });
    };

    subscribeEvents(dragStartEventNames, handleNodeDragStart);
    subscribeEvents(dragEndEventNames, handleNodeDragEnd);
    console.info('[BreadboardAutoWire] Registered drag handlers for events:', dragStartEventNames.concat(dragEndEventNames));

    const shouldHandleRelayMessages = !eventBus?.on;
    const relayListener = (event) => {
      if (!shouldHandleRelayMessages) return;
      const payload = event?.data;
      if (!payload || payload.type !== 'breadboard:relayNodeDrag') return;
      const { eventName, details } = payload;
      const normalizedName = normalizeEventName(eventName);
      if (normalizedDragStartNames.has(normalizedName)) {
        handleNodeDragStart(details || {});
      } else if (normalizedDragEndNames.has(normalizedName)) {
        handleNodeDragEnd(details || {});
      }
    };
    if (shouldHandleRelayMessages) {
      window.addEventListener('message', relayListener);
      registerCleanup(() => window.removeEventListener('message', relayListener));
    }

    console.info('[BreadboardAutoWire] Registered nodeDragEnd handler (public script).');

    const detach = () => {
      cleanupCallbacks.forEach(fn => {
        try {
          fn();
        } catch (err) {
          console.warn('[BreadboardAutoWire] Cleanup callback failed:', err);
        }
      });
      cleanupCallbacks.length = 0;
      attemptAttach._attached = false;
    };

    const primeAutoWire = () => {
      const snapshot = readGraphSnapshot(api);
      if (!snapshot?.nodes) return;
      snapshot.nodes.forEach(node => {
        if (!node?.id) return;
        pendingDragEndNodeIds.add(node.id);
      });
      scheduleDragEndProcessing(processNodeDragEnd);
    };

    primeAutoWire();

    // IMPORTANT: use a script-specific global so we don't clobber any
    // host-level helper that also uses __breadboardAutoWireCleanup.
    window.__breadboardScriptAutoWireCleanup = detach;
    return detach;
  };

  attemptAttach();
})();
